import React from 'react';
import s from "../Category/Category.module.css";
import {NavLink} from "react-router-dom";

const Subcategories = () => {
  return (
      <div className={s.subCat}>
        <NavLink className={s.categoryName} to={props.urlCategory}>
          <div className={`${s.categoryLogoEclipse} ${s.categoryLogo}`}>
            <img className={s.categoryLogo} src={props.imgPath} alt={''}/>
          </div>
          {props.nameCategory}
        </NavLink>
      </div>
  );
};

export default Subcategories;
